INSERT INTO `resumes` (`idThese`, `langue`, `resume`) VALUES
(109, 'fr', 'La caractérisation de la matière organique à l\'échelle des petits fleuves est idéale pour identifier les processus biogéochimiques locaus car la surface réduite du bassin versant permet une approche plus complète. '),
(266, 'fr', 'Etude des proprietes d\'adsorption de l\'hydrogene et des proprietes catalytiques des phases de laves de types rni::(2), avec r=la ou ce'),
(288, 'fr', 'Description et comparaison des ultrastructures des tubes polliniques, en culture in vitro, appartenant à plusieurs espèces. Étude des phénomènes cellulaires liés à la germination. Analyse des processus de mise en place des composés pariétaux'),
(294, 'fr', 'Etude du mecanisme de l\'inhibition de la corrosion du fer et du zinc en milieu sulfurique par des mono et des diphosphines. Mecanisme d\'adsorption des phosphines (physisorption, chimisorption) selon le metal'),
(300, 'fr', 'Resultats d\'etudes realisees a l\'aide de methodes optiques'),
(311, 'fr', 'Identification des genes des deux chaines de la propionyl-coa carboxylase, localisation sur les chromosomes 13 et 3, etude du polymorphisme'),
(312, 'fr', 'Etude de l\'influence de l\'irradiation de cibles si par des ions oxygene sur la pulverisation, l\'oxydation et le desordre dans le cristal et l\'etude du bombardement de si par si (autopulverisation, recuits apres implantation)'),
(313, 'fr', 'Etude des concepts de la telematique et de sa mise en oeuvre. Conception d\'un centre serveur a partir du logiciel jlbdoc'),
(316, 'fr', 'Etude du comportement des anions (no::(3)**(-), cl**(-) et carboxylates) pendant la croissance des cellules d\'a. P. En suspension dans le milieu de heller, puis analyse des cinetiques d\'absorption et d\'accumulation du mo::(3)**(-)'),
(346, 'fr', 'Les images synthetiques sont engendrees en realisant la projection perspective de scenes tridimensionnelles contenant des objets modelises par des facettes planes polygonales'),
(347, 'fr', 'Analyse des traceurs des principales sources d\'aerosols : source marine (na); erosion eolienne des sols (al); activite humaines (cd,mn, pb, v); activite volcanique (po 210) ainsi que de metaux dissous et particulaires dans les eaux de pluie'),
(352, 'fr', 'Étude par spectrométrie exafs et par analyse de la relaxation structurale en fonction de la température des propriétés structurales de CoSn. Calcul et étude expérimentale des structures électroniques de Fesn et CoSn'),
(359, 'fr', 'Mise au point d\'une méthode fiable et reproductible, permettant une propagation végétative rapide de noyers hybrides, exempts de toute contamination'),
(368, 'fr', 'Regulation des recepteurs par l\'heme, le fer et la protoporphyrine ix. Ce meme mecanisme est operant pendant la croissance des cellules en culture, lors de l\'activation de la proliferation et durant le processus de maturation cellulaire'),
(371, 'fr', 'Etude theorique et experimentale de l\'interaction d\'une onde de rayleigh avec les defauts de surface (rainures simples et rugosites aleatoires)'),
(376, 'fr', 'Etudes, en particulier, de la stabilite et de la corrosion des semiconducteurs donnes, au cours des reactions chimiques et photoelectrochimiques, dans differentes conditions'),
(382, 'fr', 'Etude par potiométrie et calorimétrie et RPE'),
(398, 'fr', 'Etude de l\'evolution du comportement du beton lorsqu\'il est soumis a des modifications de ses constituants ou de fabrication'),
(400, 'fr', 'Détermination dis constantes de stabilité des complexes ma et ma :(2) avec alpha -alamine, béta -phénylalanine, di- et tri peptides de l\'histidine : his-gly, his-val, his-ala, his-gly-gly et gly-his-gly, alpha -glu-gly et gly-glu. Structure'),
(410, 'fr', 'Mise en evidence dans le compose de structure wurtzite d\'un polaron accepteur. Son anisotropie est etablie en etudiant son orientation sous champ magnetique et l\'effet du pompage optique'),
(422, 'fr', 'Pas de résumé disponible'),
(494, 'fr', 'Etude des surfaces \"naturelles\" de l\'INP en notant une certaine \"fragilité\" de ces dernières, en particulier sous l\'influence de la température ou des faisceaux d\'ions'),
(586, 'fr', 'Étude de divers problèmes lies aux graphes de Hamming'),
(647, 'fr', 'Ce travail est consacré à l\'étude des fragments produits dans la fission induite par neutrons thermiques de l\'235 U, effectuée à l\'aide du spectromètre temps de vol-énergie \"Cosi Fan Tutte\". . . '),
(664, 'fr', 'Pas de résumé en anglais'),
(666, 'fr', 'Synthese de nouveaux composes d\'insertion graphite-tifu, graphite ruf::(5) et graphite-osf::(5). Performances en tant que materiaux cathodiques dans des generateurs electrochimiques au li'),
(672, 'fr', 'Mise en evidence, par immunohistologie et radioimmunologie, de l\'activite neurosecretrice du systeme nerveux central d\'embryons de criquet migrateur au cours du developpement embryonnaire'),
(696, 'fr', 'Mise au point d\'une méthode d\'optimisation des machines à reluctance basée sur l\'utilisation de fonctions énergétiques'),
(701, 'fr', 'L\'adaptation des êtres vivants'),
(724, 'fr', 'Etude d\'un servomoteur realise a partir d\'une machine a commutation statique a onduleur a transistors. Determination des caracteristiques electromecaniques en regime permanent. Determination d\'un mode de commande base sur la caracteristique thermique'),
(750, 'fr', 'Etude experimentale de la faisabilite du procede en fonction de la composition du melange a separer et mise en place de modeles mathematiques au vu des resultats experimentaux'),
(888, 'fr', 'On étudie la détection et le suivi des phénomènes météorologiques sur des images de la terre et on développe une méthode d\'animation de ces images'),
(1094, 'fr', 'Utilisation de carbonyles. . . De cobalt pour catalyser l\'attaque des composés porteurs de fonctions hydroxylées sur des carbonates organiques cycliques et des époxydes dans le but d\'obtenir des ethers beta -hydroxyles'),
(1184, 'fr', 'Étude des algorithmes de commande pour les systèmes linéaires discrets multivariables modélisés par une représentation entrée sortie'),
(1237, 'fr', 'Construction de connaissances à propos du financement des entreprises et des efforts d\'industrialisation par les collectivités locales, et réflexion transversale sur une série d\'observations et de travaux'),
(1301, 'fr', 'Le résumé en français n\'a pas été communiqué par l\'auteur.'),
(1316, 'fr', 'La résistance thérapeutique est un des enjeux majeurs dans le traitement des cancers.'),
(1353, 'fr', 'Le VIP ET l\'xpression des récepteurs dans l\'épithélium intestinal chez l\'homme et le rat sont étudiés. Une étude comparative est faite avec une lignée tumorale de colon humain HT29-18 indifférenciée et chez le [foetus] porteur de la muciviscidose'),
(1356, 'fr', 'Utilisation de la propriété hypocholestérolemiante des phytostérols, pour induire une baisse naturelle de la cholestérolémie, par des supplémentations de l\'alimentation');
